import React, {FC} from 'react';


export enum Type{
    typex='src/res/round.png',
    typeo='src/res/x.png',
    none='none'
}
export interface ToeProps {
    type?: Type
}

const Toe: FC<ToeProps> = ({type}) => {
    // @ts-ignore
    return (
        <div style={{
            border:'1px solid black',
            display:'flex',
            backgroundColor:'lightgray',
            width:'90px',
            height:'90px',
            alignSelf:'center',
            verticalAlign:'baseline',
            flexFlow:'row wrap',
            flexWrap:'wrap'
        }}
        >
            <img style={{width:'90px',height:'90px'}} src={type==Type.none ?  ' ' : type?.toString()}/>

        </div>
    );
};

export default Toe;
